import React from "react";
import { useState } from "react";

const Useeffect =()=>{
    const [item,setitem] = useState(0)
    const func =()=>{
        setitem(item+1)
    }

    return(
        <>
        <div>
            <button onClick={func}>Click!!!{item}</button>
        </div>
        </>
    )
}

export default Useeffect
